  \"2016-07-27T22:42:13.531078\",\n\t\"name\": \"organchlorine-pesticide-and-heavy-metal-contamination-of-american-crocodile-crocodylus-acu\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Four eggs collected from two nests of the
  American crocodile (Crocodylus acutus), an endangered species occurring in southern
  Florida, were analyzed for organochlorine pesticide residues, mercury and lead content.
  A variety of organochlorine compounds, including polychlorinated biphenyls, were
  found, but concentrations were low when compared to other species. Lead was not
  detected in any of the eggs and mercury was only detectable in two of the four eggs.
  It does not appear that any of these contaminants, with the possible exception of
  PCBs, were responsible for non-viable eggs.\",\n\t\"license_title\": \"License Not
